import './table.css';
import Search from '../search/search';
import React, { useState, useEffect } from 'react';
import axios from 'axios';


function Table() {


    const [data, setData] = useState([]);


    useEffect(() => {
        // Make an HTTP GET request to the backend server using Axios
        axios.get('http://localhost:3001/data')
          .then((response) => {
            // Set the data state variable with the response data
            setData(response.data);
            //console.log(data)
          })
          .catch((error) => {
            // Handle any errors that occur during the request
            console.error(error);
          });
      }, []);

    // Helper function to format the date string
    const formatDate = (dateString) => {
        if (!dateString) {
            return ''; // Return empty string if dateString is null or undefined
        }
        const date = new Date(dateString);
        const year = date.getFullYear();
        const month = String(date.getMonth() + 1).padStart(2, '0');
        const day = String(date.getDate()).padStart(2, '0');
        return `${month}-${day}-${year}`;
    }


    return (

        <div>
            <Search data={data} setData={setData}/>
            <div className='tableSec'>
                <table className='blueTable'>
                    <thead>
                        <tr>
                            <th>Date</th>
                            <th>Time</th>
                            <th>Pressure Value</th>
                            <th>Technician Name</th>
                            <th>Job Number</th>
                            <th>Serial Number</th>
                            {/* <th>Pass/Fail</th> */}
                            <th>Notes</th>
                        </tr>
                    </thead>
                    <tbody>
                        {data.map((row ) => (
                            <tr key={row.pressure_id}>
                                <td>{formatDate(row.date_collected)}</td>
                                <td>{row.time_collected}</td>
                                <td>{row.pressure_value}</td>
                                <td>{row.tech_name}</td>
                                <td>{row.job_num}</td>
                                <td>{row.serial_num}</td>
                                {/* <td>{row.pass_fail}</td> */}
                                <td>{row.notes}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    )
}

export default Table;




